import React from 'react';
import { Link } from 'react-router-dom';

const FloatingActionButton = () => {
  return (
    <div className="fixed bottom-8 right-8">
      <Link
        to="/query-form"
        className="bg-blue-600 text-white px-6 py-3 rounded-full shadow-lg hover:bg-blue-700 transition duration-300 flex items-center justify-center"
      >
        Ask a Query
      </Link>
    </div>
  );
};

export default FloatingActionButton;
